function saveAsHTML(){
    let doc = document.implementation.createHTMLDocument("Album");

    //body

    var holder = doc.createElement("div");
    holder.classList="album";
    
    var retBtn = doc.createElement("button");
    retBtn.id="retBtn";
    retBtn.innerHTML="<";
    holder.appendChild(retBtn);

    var nextBtn = doc.createElement("button");
    nextBtn.id="nextBtn";
    nextBtn.innerHTML=">";
    holder.appendChild(nextBtn);

    var side = 1;
    containers.forEach(container => {
        var cont = doc.createElement("div");
        cont.classList="page"+side;
        side = side==1?2:1;
        var counter = 0;
        var imagesPerPage = container.children.length;
        Array.from(container.children).forEach(element => {
            counter++;
            var img = element.children[0];
            var canvas = document.createElement("canvas");
            canvas.width=img.naturalWidth;
            canvas.height=img.naturalHeight;
            canvas.getContext("2d").drawImage(img,0,0);
            if(counter>2){
                if(counter%2==1){
                    holder.appendChild(cont);
                    cont = doc.createElement("div");
                    cont.classList="page"+side;
                    side = side==1?2:1;
                }
            }
            var div = doc.createElement("div");
            div.classList="img";
            var image = doc.createElement("img");
            image.src=canvas.toDataURL();
            div.appendChild(image);
            cont.appendChild(div);
            
        });
        if(imagesPerPage!=0)
            holder.appendChild(cont);
    });

    doc.body.appendChild(holder);
    //js 

    var js = doc.createElement('script');
    js.type="text/javascript";
    js.appendChild(document.createTextNode('const pages1 = document.querySelectorAll(".page1"); const pages2 = document.querySelectorAll(".page2"); var max = pages1.length>=pages2.length?pages1.length-1:pages2.length-1; const ret = document.querySelector("#retBtn"); const next = document.querySelector("#nextBtn"); ret.setAttribute("disabled","true"); for(var i = 1; i<pages1.length;i++){ pages1[i].style.display="None"; } for(var i = 1; i<pages2.length;i++){ pages2[i].style.display="None"; } var currentPage = 0; function changePage(change){ console.log(change); pages1[currentPage].style.display="None"; if(currentPage<=pages2.length-1) pages2[currentPage].style.display="None"; currentPage += change; if(currentPage<0) currentPage=0; else if (currentPage>max) currentPage=max; if(currentPage==0){ ret.setAttribute("disabled","true"); next.removeAttribute("disabled"); } else if (currentPage==max){ next.setAttribute("disabled","true"); ret.removeAttribute("disabled"); } else{ ret.removeAttribute("disabled"); next.removeAttribute("disabled"); } pages1[currentPage].style.display="flex"; if(currentPage<=pages2.length-1) pages2[currentPage].style.display="flex";}ret.addEventListener("click",changePage.bind(null,-1));next.addEventListener("click",changePage.bind(null,1));'));
    doc.body.appendChild(js);

    //css
    var css = doc.createElement('style');
    css.type = 'text/css';
    css.appendChild(document.createTextNode(".album { display: grid; grid-template-columns: 30px 595px 595px 30px; grid-template-rows: 840px; column-gap: 5px; } .page1, .page2 { padding: 60px 40px; width: 515px; height: 720px; display: flex; flex-direction: column; flex-wrap: nowrap; align-content: center; justify-content: center; align-items: center; background-image: url(data:image/jpeg;base64,);} .page1 { grid-column-start: 2; grid-row-start: 1; } .page2 { grid-column-start: 3; grid-row-start: 1; } .img{text-align: center; padding: 10px 0px; height: 340px; width: 515px; } img{ max-width: 100%; max-height: 100%; } .img:only-child{ text-align: center; padding: 10px 0px; height: 700px; width: 515px; display: flex; align-content: center; flex-direction: column;justify-content: center; flex-wrap: nowrap;} #retBtn { grid-column-start: 1; grid-row-start: 1; } #nextBtn { grid-column-start: 4; grid-row-start: 1;}"));

    doc.head.appendChild(css);
    
    var link = document.createElement("a");
    link.download = "album.html";
    link.href = "data:text/html;charset=UTF-8,"+encodeURIComponent(doc.documentElement.outerHTML);
    link.click();
}